import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./pages/Home";
import Services from "./pages/Services";
import Strategy from "./pages/Strategy";
import CasesClients from "./pages/Cases&Clients";
import About from "./pages/About";
import Contact from "./pages/Contact";
import Navigation from "./pages/Navigation";
import "bootstrap/dist/css/bootstrap.min.css";

function App() {
  return (
    <Router>
      <Navigation />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/" element={<Services />} />
        <Route path="/" element={<Strategy />} />
        <Route path="/" element={<CasesClients />} />
        <Route path="/" element={<About />} />
        <Route path="/" element={<Contact />} />
      </Routes>
    </Router>

    // <Router>
    //   <Routes>
    //     <Route path="/home" element={<Home />}></Route>
    //     <Route path="/services" element={<Services />}></Route>
    //     <Route path="/strategy" element={<Strategy />}></Route>
    //     <Route path="/cases&clients" element={<CasesClients />}></Route>
    //     <Route path="/about-us" element={<About />}></Route>
    //     <Route path="/contact-and-support" element={<Contact />}></Route>
    //   </Routes>
    // </Router>
  );
}

export default App;
